import React from "react";
import DarkMode from "../DarkMode";
import styled from "styled-components";
import { Link } from "react-router-dom";

const AsideBar = styled.aside`
  position: relative;
  left: -510px;
`;

const Nav = styled.nav``;

const Ul = styled.ul`
  list-style: none;
`;

const ListTitle = styled.p`
  font-family: Lato;
  font-weight: 700;
  font-size: 18px;
  line-height: 21.6px;
  color: ${({ theme }) =>
    theme.isDarkMode ? "rgba(249, 249, 249, 0.67)" : "black"};
`;

const Li = styled.li`
  color: white;
`;
const StyledLink = styled(Link)`
  background-color: ${({ theme }) => (theme.isDarkMode ? "black" : "#fff")};
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
  text-decoration: none;
`;

const Aside = () => {
  return (
    <AsideBar>
      <Nav>
        <Ul>
          <ListTitle>
            Menu <DarkMode />
          </ListTitle>
          <Li>
            <StyledLink to="/">Home</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Discover</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Awards</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Celebrities</StyledLink>
          </Li>
        </Ul>
        <Ul>
          <ListTitle>Library</ListTitle>
          <Li>
            <StyledLink to="/">Recent</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Top Rated</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Downloaded</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Playlists</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Watchlist</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Completed</StyledLink>
          </Li>
        </Ul>
        <Ul>
          <ListTitle>General</ListTitle>
          <Li>
            <StyledLink to="/">Settings</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Log Out</StyledLink>
          </Li>
        </Ul>
      </Nav>
    </AsideBar>
  );
};

export default Aside;
